abstract:
Carta della Rete Ecologica Siciliana - Servizio di Consultazione
Carta della Rete Ecologica Siciliana, che contiene alcune delle tipiche unità funzionali della rete:
- nodi o core areas = parchi, riserve, sic e zps
- corridoi lineari (da riqualificare e non);
- corridoi diffusi (da riqualificare e non);
- zone cuscinetto o buffer zones;
- pietre da guado o stepping stones
